require.config({"config": {
        "text":{"Magento_Ui/templates/form/element/checkbox.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"choice field\">\n    <input type=\"checkbox\"\n           class=\"checkbox\"\n           data-bind=\"\n           checked: value,\n           attr: {\n                id: uid,\n                disabled: disabled,\n                name: inputName,\n                'aria-describedby': getDescriptionId(),\n                'aria-required': required,\n                'aria-invalid': error() ? true : 'false'\n                },\n           hasFocus: focused\">\n\n    <label class=\"label\" data-bind=\"checked: value, attr: { for: uid }\">\n        <span data-bind=\"text: description || label\"></span>\n    </label>\n\n    <!-- ko if: notice -->\n        <div class=\"field-note\" data-bind=\"attr: {id: noticeId}\"><span data-bind=\"text: notice\"></span></div>\n    <!-- /ko -->\n</div>\n"}
}});
